/*Table structure for table `student_personal_info` */

DROP TABLE IF EXISTS `student_personal_info`;

CREATE TABLE `student_personal_info` (
  `student_code` int(11) NOT NULL DEFAULT '0',
  `campus_code` varchar(10) NOT NULL DEFAULT '',
  `gr_no` varchar(15) NOT NULL DEFAULT '',
  `admission_date` date DEFAULT NULL,
  `first_name` varchar(50) NOT NULL DEFAULT '',
  `last_name` varchar(50) NOT NULL DEFAULT '',
  `dob` date DEFAULT NULL,
  `birth_place` varchar(30) NOT NULL DEFAULT '',
  `nationality` varchar(30) NOT NULL DEFAULT '',
  `mother_tongue` varchar(30) NOT NULL DEFAULT '',
  `gender` varchar(1) NOT NULL DEFAULT '',
  `religion` varchar(30) NOT NULL DEFAULT '',
  `address` varchar(100) NOT NULL DEFAULT '',
  `telephone` varchar(20) NOT NULL DEFAULT '',
  `emergency_no` varchar(20) NOT NULL DEFAULT '',
  `illness` varchar(100) NOT NULL DEFAULT '',
  `physical_impairment` varchar(100) NOT NULL DEFAULT '',
  `family_doctor` varchar(75) NOT NULL DEFAULT '',
  `doctor_contact` varchar(20) NOT NULL DEFAULT '',
  `status` varchar(1) NOT NULL DEFAULT '',
  `createdby` int(10) DEFAULT NULL,
  `createdon` datetime DEFAULT NULL,
  `updatedby` int(10) DEFAULT NULL,
  `updatedon` datetime DEFAULT NULL,
  KEY `campusstudentcode` (`campus_code`,`student_code`),
  KEY `gr_no` (`gr_no`),
  KEY `admission_date` (`admission_date`),
  KEY `student_code` (`student_code`),
  KEY `campus_code` (`campus_code`),
  KEY `createdby` (`createdby`),
  KEY `createdon` (`createdon`),
  KEY `updatedby` (`updatedby`),
  KEY `updatedon` (`updatedon`)
