  `student_code` int(11) NOT NULL DEFAULT '0',
  `session_code` varchar(10) NOT NULL,
  `fee_month_year` varchar(20) NOT NULL,
  `due_month` varchar(20) NOT NULL DEFAULT '',
  `fee_code` int(11) NOT NULL DEFAULT '0',
  `payable` decimal(13,2) NOT NULL DEFAULT '0.00',
  `receipt_category` char(1),
  `receipt_no` int(11) DEFAULT NULL,
  `paid` decimal(12,2) DEFAULT NULL,
  `due_date` date DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1 */;

/*Table structure for table `v_receipt` */

