  `session_code` varchar(10) NOT NULL DEFAULT '',
  `receipt_category` char(1) NOT NULL,
  `receipt_no` int(11) NOT NULL DEFAULT '0',
  `receipt_date` datetime DEFAULT NULL,
  `student_code` int(11) NOT NULL DEFAULT '0',
  `fee_code` int(11) NOT NULL DEFAULT '0',
  `fee_month_year` varchar(20) NOT NULL DEFAULT '',
  `penalty` decimal(12,2) NOT NULL DEFAULT '0.00',
