/*!50001 CREATE TABLE `vw_fee_concession` (
  `session_code` varchar(10) NOT NULL DEFAULT '',
  `campus_code` varchar(10) NOT NULL DEFAULT '',
  `shift_code` varchar(15) NOT NULL DEFAULT '',
  `class_code` varchar(20) NOT NULL DEFAULT '',
  `class_name` varchar(50) NOT NULL DEFAULT '',
  `section_code` varchar(20) NOT NULL DEFAULT '',
  `section_name` varchar(50) NOT NULL DEFAULT '',
  `student_code` int(11) NOT NULL DEFAULT '0',
  `gr_no` varchar(15) NOT NULL DEFAULT '',
  `student_name` varchar(101) NOT NULL DEFAULT '',
  `father_name` varchar(100) NOT NULL DEFAULT '',
  `fee_month_year` varchar(20) DEFAULT '',
  `fee_code` int(11) DEFAULT '0',
  `discounted_fee` decimal(12,2) DEFAULT '0.00',
  `actual_amount` decimal(12,2) DEFAULT '0.00'
) ENGINE=MyISAM DEFAULT CHARSET=latin1 */;

/*View structure for view v_ledger */

/*!50001 DROP TABLE IF EXISTS `v_ledger` */;
/*!50001 DROP VIEW IF EXISTS `v_ledger` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_ledger` AS select `sfm`.`student_code` AS `student_code`,`sfm`.`session_code` AS `session_code`,`sfm`.`fee_month_year` AS `fee_month_year`,`sfm`.`due_month` AS `due_month`,`sfm`.`fee_code` AS `fee_code`,(`sfm`.`amount` - `sfm`.`concession_awarded`) AS `payable`,`b`.`receipt_category` AS `receipt_category`,`b`.`receipt_no` AS `receipt_no`,if(isnull(`b`.`amount`),0,`b`.`amount`) AS `paid`,str_to_date(concat(`fm`.`due_date`,' ',`fm`.`due_month`),'%d %M, %Y') AS `due_date` from ((`student_fee_months` `sfm` left join `v_receipt` `b` on(((`b`.`student_code` = `sfm`.`student_code`) and (`b`.`session_code` = `sfm`.`session_code`) and (`b`.`fee_month_year` = `sfm`.`fee_month_year`) and (`b`.`fee_code` = `sfm`.`fee_code`)))) join `fee_maturity` `fm` on(((`fm`.`session_code` = `sfm`.`session_code`) and (`fm`.`fee_month_year` = `sfm`.`fee_month_year`) and (`fm`.`due_month` = `sfm`.`due_month`) and (`fm`.`fee_code` = `sfm`.`fee_code`)))) */;

/*View structure for view v_receipt */

/*!50001 DROP TABLE IF EXISTS `v_receipt` */;
/*!50001 DROP VIEW IF EXISTS `v_receipt` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_receipt` AS select `r`.`session_code` AS `session_code`,`r`.`receipt_category` AS `receipt_category`,`r`.`receipt_no` AS `receipt_no`,`r`.`receipt_date` AS `receipt_date`,`r`.`student_code` AS `student_code`,`rd`.`fee_code` AS `fee_code`,`rd`.`fee_month_year` AS `fee_month_year`,`rd`.`penalty` AS `penalty`,`rd`.`amount` AS `amount` from (`receipts` `r` join `receipts_detail` `rd` on(((`rd`.`receipt_category` = `r`.`receipt_category`) and (`rd`.`receipt_no` = `r`.`receipt_no`) and (`rd`.`session_code` = `r`.`session_code`)))) */;

/*View structure for view v_students */

/*!50001 DROP TABLE IF EXISTS `v_students` */;
/*!50001 DROP VIEW IF EXISTS `v_students` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_students` AS select `student_class_section_log`.`session_code` AS `session_code`,`student_personal_info`.`student_code` AS `student_code`,`student_personal_info`.`campus_code` AS `campus_code`,`student_personal_info`.`gr_no` AS `gr_no`,`student_personal_info`.`first_name` AS `first_name`,`student_personal_info`.`last_name` AS `last_name`,`student_personal_info`.`admission_date` AS `admission_date`,`student_personal_info`.`dob` AS `dob`,`student_personal_info`.`birth_place` AS `pob`,`student_personal_info`.`religion` AS `religion`,`parent_guardian_info`.`father_name` AS `father_name`,`student_class_section_log`.`roll_no` AS `roll_no`,`class`.`class_code` AS `class_code`,`class`.`class_name` AS `class_name`,`section`.`section_code` AS `section_code`,`section`.`section_name` AS `section_name`,`shift`.`shift_code` AS `shift_code`,`shift`.`shift_name` AS `shift_name`,`student_class_section_log`.`status` AS `status` from (((((`student_personal_info` join `parent_guardian_info` on(((`student_personal_info`.`student_code` = `parent_guardian_info`.`student_code`) and (`student_personal_info`.`campus_code` = `parent_guardian_info`.`campus_code`)))) join `student_class_section_log` on(((`student_personal_info`.`student_code` = `student_class_section_log`.`student_code`) and (`student_personal_info`.`campus_code` = `student_class_section_log`.`campus_code`)))) join `section` on((`student_class_section_log`.`section_code` = `section`.`section_code`))) join `class` on((`section`.`class_code` = `class`.`class_code`))) join `shift` on((`class`.`shift_code` = `shift`.`shift_code`))) where ((`student_class_section_log`.`status` = _latin1'A') and (`student_personal_info`.`status` = _latin1'A')) */;

/*View structure for view vw_fee_concession */

/*!50001 DROP TABLE IF EXISTS `vw_fee_concession` */;
/*!50001 DROP VIEW IF EXISTS `vw_fee_concession` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_fee_concession` AS select `s`.`session_code` AS `session_code`,`s`.`campus_code` AS `campus_code`,`s`.`shift_code` AS `shift_code`,`s`.`class_code` AS `class_code`,`s`.`class_name` AS `class_name`,`s`.`section_code` AS `section_code`,`s`.`section_name` AS `section_name`,`s`.`student_code` AS `student_code`,`s`.`gr_no` AS `gr_no`,concat(`s`.`first_name`,_latin1' ',`s`.`last_name`) AS `student_name`,`s`.`father_name` AS `father_name`,`r`.`fee_month_year` AS `fee_month_year`,`r`.`fee_code` AS `fee_code`,`r`.`amount` AS `discounted_fee`,`fs`.`amount` AS `actual_amount` from ((`v_students` `s` left join `v_receipt` `r` on(((`s`.`session_code` = `r`.`session_code`) and (`s`.`student_code` = `r`.`student_code`) and (`r`.`fee_code` = 1) and (left(`r`.`fee_month_year`,6) = _latin1'AUGUST')))) left join `fee_structure` `fs` on(((`fs`.`class_code` = `s`.`class_code`) and (`fs`.`fee_code` = 1) and (`fs`.`campus_code` = `s`.`campus_code`)))) group by `s`.`session_code`,`s`.`campus_code`,`s`.`class_code`,`s`.`class_name`,`s`.`section_code`,`s`.`section_name`,`s`.`student_code`,`s`.`gr_no` */;

